description:
Anna Ternheim (born May 31, 1978) is a Swedish singer-songwriter who performs in English. She released her debut album Somebody Outside in 2004. The Swedish Grammyjury awarded her as Best Newcomer of the year, and was nominated for Best Female Artist, Best Lyricist and Best Songwriter of 2005. She also won the P3 Guld award for Best Newcomer 2004. For her second album, Separation Road released on September 27, 2006, she was awarded Best Female Artist and Best Lyricist of the Swedish Grammyjury, again she was nominated for Best Songwriter and Best Album. P3 Gold awarded her Best Female Artist the same year. April 22, 2008 was released her US debut album Halfway to Fivepoints. &lt;a href=&quot;
